webpackJsonp([0xa356c7b6aec7],{1757:function(A,a){A.exports={data:{markdownRemark:{html:'<p>I\'m gonna share some information about my trip to <strong>Bangkok</strong> - Thailand. Hope it will be helpful for those who plan to travel there.</p>\n<h2 id="span-stylecolorred-silom--patpong-span"><a href="#span-stylecolorred-silom--patpong-span" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a><span style="color:red"> Silom &#x26; Patpong </span></h2>\n<p>I decided to go to Silom night market first. There weren\'t many things to see from Chuck to Silom Center so we just wandered around the street. On the sidewalks, people were selling many kinds of stuff. If you want to buy some unique printed shirts, just come here. Besides, walking around and you\'ll see the pictures of NAKED male/female!</p>\n<p>We also went to the famous red light street but we were not allowed to shoot. This road is quite bustling and both sides have many Japanese restaurants. The girls in cosplay invite guests along both sides of the street. I heard that the male-male street is also interesting but I just skipped it. üòÅ</p>\n<h2 id="span-stylecolordeepskyblue-central-pier---chao-phraya-express-boat-span"><a href="#span-stylecolordeepskyblue-central-pier---chao-phraya-express-boat-span" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a><span style="color:deepskyblue"> Central Pier - Chao Phraya Express Boat </span></h2>\n<p>The Central Pier providing a kind of water transportation service called The Chao Phraya Tourist Boat, where many high quantity colorful boats travel from pier to pier without worrying about purchasing extra boat tickets or getting lost. Although the docks are not so large, they have English signboards and even an English speaking guide.</p>\n<figure>\n  \n  <a class="gatsby-resp-image-link" href="/static/bangkok-1-8bf9d4cbc9731f6cc8d173ebeed53c63-bd08e.png" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 1200px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 88.130081300813%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/jpeg;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="bangkok 1" title="" src="/static/bangkok-1-8bf9d4cbc9731f6cc8d173ebeed53c63-abe1c.png" srcset="/static/bangkok-1-8bf9d4cbc9731f6cc8d173ebeed53c63-10046.png 300w,\n/static/bangkok-1-8bf9d4cbc9731f6cc8d173ebeed53c63-3c4a3.png 600w,\n/static/bangkok-1-8bf9d4cbc9731f6cc8d173ebeed53c63-abe1c.png 1200w,\n/static/bangkok-1-8bf9d4cbc9731f6cc8d173ebeed53c63-bd08e.png 1230w" sizes="(max-width: 1200px) 100vw, 1200px">\n    </span>\n  </span>\n  \n  </a>\n    \n  <figcaption style="font-size: 17px; align=" center"=""> <span style="color:deepskyblue">&#xA0;The scenes from two sides seeing on a motor boat&#xA0;</span> </figcaption>\n</figure>\n<p>If you go to Bangkok, don\'t miss this water transportation. You can see Bangkok from a whole new perspective, trust me! You can also visit many attractions such as the Temple of Dawn and the great Reclining Buddha at Wat Pho. But I decided to pass by the famous Taling Chan Floating Market first.</p>\n<h2 id="span-stylecolorgreen-taling-chan-floating-market-span"><a href="#span-stylecolorgreen-taling-chan-floating-market-span" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a><span style="color:green"> Taling Chan Floating Market </span></h2>\n<p>When the express boat arrived, we took a taxi to Taling Chan Floating Market, which is 20km from the center but the taxi fare was quite cheap. This market has everything you need to spend a good half day and you don‚Äôt need to book a tour for it. Here you can enjoy a great seafood lunch on the floor with the locals, or having a long tail boat ride around the nearby canals for 100 baht (~$3), do shopping and tasting a lot of food. You can even get a foot massage for only 200 baht (~$6).</p>\n<p>Taling Chan Floating Market is not too big and has many Thai people so the traditional specifics have still remained. Goods are also cheap, and the cuisine is so delicious and diverse. The salesmen are very mindful decorating clean, nice and orderly stalls.</p>\n<figure>\n  \n  <a class="gatsby-resp-image-link" href="/static/bangkok-2-d48da33d1129806eafefbdd33bd569af-33a7d.png" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 1200px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 78.04107424960506%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/jpeg;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="bangkok 2" title="" src="/static/bangkok-2-d48da33d1129806eafefbdd33bd569af-abe1c.png" srcset="/static/bangkok-2-d48da33d1129806eafefbdd33bd569af-10046.png 300w,\n/static/bangkok-2-d48da33d1129806eafefbdd33bd569af-3c4a3.png 600w,\n/static/bangkok-2-d48da33d1129806eafefbdd33bd569af-abe1c.png 1200w,\n/static/bangkok-2-d48da33d1129806eafefbdd33bd569af-33a7d.png 1266w" sizes="(max-width: 1200px) 100vw, 1200px">\n    </span>\n  </span>\n  \n  </a>\n    \n  <figcaption> </figcaption>\n</figure>\n<p>Thai crispy pancake looks like Vietnamese pancakes but the taste is totally diferent. The yellow colored pancake that had additional cream layer was very sweet. While the light orange colored one tasted both sweet and salty, which I preferred more.</p>\n<figure>\n  \n  <a class="gatsby-resp-image-link" href="/static/bangkok-3-3a92709a32a45efe3bbe93ca431a8424-cff7c.png" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 854px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 101.63934426229508%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/jpeg;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="bangkok 3" title="" src="/static/bangkok-3-3a92709a32a45efe3bbe93ca431a8424-cff7c.png" srcset="/static/bangkok-3-3a92709a32a45efe3bbe93ca431a8424-3c3b6.png 300w,\n/static/bangkok-3-3a92709a32a45efe3bbe93ca431a8424-9cd70.png 600w,\n/static/bangkok-3-3a92709a32a45efe3bbe93ca431a8424-cff7c.png 854w" sizes="(max-width: 854px) 100vw, 854px">\n    </span>\n  </span>\n  \n  </a>\n    \n  <figcaption> </figcaption>\n</figure>\n<h2 id="span-stylecolordarkorchid-wat-arun--temple-of-dawn-span"><a href="#span-stylecolordarkorchid-wat-arun--temple-of-dawn-span" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a><span style="color:darkorchid"> Wat Arun ‚Äì Temple of Dawn </span></h2>\n<p>Wat Arun is Bangkok\'s oldest temple. When King Thaksin decided to build his new capital in Thonburi he came here at dawn. So he renamed it Wat Jang, "Jang" means the cleanness, brightness of dawn. The most interesting of Wat Arun temple is the decoration of the temple gates. They are built of brick and covered with colorful Chinese porcelain.</p>\n<p>If you wear shorts, short skirts and tank top, you must hire a long cloth to cover. As the place is quite crowded, bring your own cloth to avoid time-consuming if possible.  </p>\n<figure>\n  \n  <a class="gatsby-resp-image-link" href="/static/bangkok-4-c7eebbeea90b3ecdcb93563b4a6e7ff3-bf9db.png" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 1144px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 63.89860139860139%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/png;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="bangkok 4" title="" src="/static/bangkok-4-c7eebbeea90b3ecdcb93563b4a6e7ff3-bf9db.png" srcset="/static/bangkok-4-c7eebbeea90b3ecdcb93563b4a6e7ff3-dfb9d.png 300w,\n/static/bangkok-4-c7eebbeea90b3ecdcb93563b4a6e7ff3-46331.png 600w,\n/static/bangkok-4-c7eebbeea90b3ecdcb93563b4a6e7ff3-bf9db.png 1144w" sizes="(max-width: 1144px) 100vw, 1144px">\n    </span>\n  </span>\n  \n  </a>\n    \n  <figcaption> </figcaption>\n</figure>\n<p>If you climb up the stone stairs to the balcony, you can see the panoramic view of Chao Phraya River and Bangkok from Rama I Bridge to the Grand Palace and Wat Pho.</p>\n<p>Located next to the waterfront, Wat Arun truly becomes one of the great attractions in the capital, which allows you to have a marvelous sightseeing. It is a symbol of Bangkok tourism with very special Thai-style architecture.</p>\n<p>This is the first part of the trip and the rest will be posted <a href="http://aquabubu.com/blog/travel/A-trip-to-Bangkok-Part-2/" target="_blank">here </a>.</p>',timeToRead:3,excerpt:"I'm gonna share some information about my trip to  Bangkok  - Thailand. Hope it will be helpful for those who plan to travel there.  Silom‚Ä¶",frontmatter:{title:"Bangkok trip - Part 1",cover:"/images/bangkok1.png",date:"2014/09/10",category:"Travel",tags:["Travel","bangkok","thailand","Î∞©ÏΩï","ÌÉúÍµ≠","du-lich","cho-noi-tailingchan","wat-pho","thai-lan"]},fields:{slug:"/en/Bangkok-trip-Part-1/"}}},pathContext:{path:"/en/Bangkok-trip-Part-1/",langKey:"en"}}}});
